import React, {Component} from "react"
import styled from 'styled-components'
import Divvy_logo from './Vector.svg';

class Divvy extends Component {
    render(){
        return (
          <HeaderContainer>
          <div className = "divvy-header">
          <div className = "logo">

          <img src={Divvy_logo} alt="divvy_logo"/>
          </div>
          <div className ="title">

            <h1>Divvy Case Study</h1>
          </div>
          <div className = "description">

            <h6>Designing an app that will encourage Gen Z users to keep track of money usage</h6>

            </div>
          </div>
          </HeaderContainer>
        );
        }
}
export default Divvy;


const HeaderContainer = styled.text`
.divvy-header{
  background:#4B4F98;
  padding: 3vw;
}
.title{
  color: #ffffff;
  text-align:center;
}
.description{
  color: #ffffff;
  text-align:center;
}
.logo{
  display: block;
  margin-left: auto;
  margin-right: auto;
  width: 10%;
  padding: 1rem;
}
`
